import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Proizvodi from "./pages/Proizvodi";

function App() {

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact component={Proizvodi}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
